INSERT INTO `comments` (`cid`, `pid`, `nid`, `uid`, `subject`, `comment`, `hostname`, `timestamp`, `status`, `format`, `thread`, `name`, `mail`, `homepage`) VALUES
(17, 0, 83, 21, 'You should not only test, but', 'You should not only test, but take a break and go running.', '24.8.50.141', 1247747805, 0, 1, '01/', 'Margaret Sparks', '', ''),
(27, 0, 129, 1, 'test comment..', 'test comment..', '95.88.22.108', 1248183152, 0, 2, '02/', 'admin', '', ''),
(14, 0, 48, 21, 'Which Friday are you starting', 'Which Friday are you starting the test run?  Is it started?', '24.8.50.141', 1247496481, 0, 1, '03/', 'Margaret Sparks', '', ''),
(15, 0, 48, 1, 'The current plan now is to', 'The current plan now is to start next Monday. Assuming I can get all the kinks worked out in time! Forgot I had written ''Friday'' on the wesite...oops. (Let me know if you get this comment as an email ... Testing the commenting system here!)', '89.247.180.10', 1247497422, 0, 1, '04/', 'admin', '', ''),
(18, 0, 83, 1, 'I''ve been doing a lot of', 'I''ve been doing a lot of running, actually. Had ultimate frisbee games every other day for the last week. My legs are *shot* today...so just sitting in a cafe for now.', '95.88.22.108', 1247837440, 0, 1, '02/', 'admin', '', ''),
(19, 0, 83, 20, 'Hope you''re getting my', 'Hope you''re getting my comments okay. So glad you''re getting good exercise...but do take it easy.', '72.161.127.3', 1247877242, 0, 1, '03/', 'Anabeth James', '', ''),
(20, 0, 99, 23, 'From Stan:\n$89.99\nThe', 'From Stan:\r\n\r\n$89.99\r\nThe Cheapest\r\nhttp://www.newegg.com/Product/Product.aspx?Item=N82E16822204079\r\n\r\n$120\r\nI''ve had good luck with Western Digital Drives\r\nhttp://www.newegg.com/Product/Product.aspx?Item=N82E16822136186\r\n\r\n$99.99\r\nBest looking drive\r\nhttp://www.newegg.com/Product/Product.aspx?Item=N82E16822111019\r\n', '89.247.180.10', 1248089177, 0, 1, '01/', 'Stan James', '', ''),
(24, 0, 129, 23, 'Testing, first', 'Testing, first comment..testing testing...', '95.88.22.108', 1248182963, 0, 2, '01/', 'Stan James', '', ''),
(28, 0, 126, 21, 'It would be helpful for us in', 'It would be helpful for us in the USA to have a clock showing what time it is for you so I don''t go adding something later today, for me, that is about to be, for you.  Or are events locked by your time of day?', '24.8.50.141', 1248184000, 0, 2, '01/', 'Margaret Sparks', '', ''),
(29, 28, 126, 23, 'Oooh, good point. I''ll have', 'Oooh, good point. I''ll have to ask Michelle where she got those "Clocks in other time zone" widgets. \r\n\r\nFor you in Denver, you have until 7pm to edit my next day.', '95.88.22.108', 1248185109, 0, 2, '01.00/', 'Stan James', '', ''),
(30, 0, 126, 21, 'I''m pretty sure she got it', 'I''m pretty sure she got it from World Clocks, which I use a lot these days. See "Free clock for your website" at:\r\nhttp://www.timeanddate.com/worldclock/city.html?n=37', '24.8.50.141', 1248185404, 0, 2, '02/', 'Margaret Sparks', '', ''),
(31, 0, 126, 37, 'Damn, I accidentally deleted', 'Damn, I accidentally deleted a short event on Wednesday! Sorry about that -- what was it??\r\n', '160.79.51.162', 1248185612, 0, 2, '03/', 'Ken Reisman', '', ''),
(32, 31, 126, 1, 'Deleted events are acutally', 'Deleted events are acutally just "un-published", and there are no such events on wedndesday. I did see that you moved the "SimStan Maintence" event to the afternoon is all. I figured you wanted me to sleep in. :)', '95.88.22.108', 1248185853, 0, 2, '03.00/', 'admin', '', ''),
(33, 0, 126, 50, 'I loved this project the', 'I loved this project the moment you spoke of it at Japango. So thrilled to see it come to fruition, Stan. You know karaoke will be on your calendar very soon, right?', '97.122.166.93', 1248198342, 0, 2, '04/', 'Gwen Bell', '', ''),
(34, 0, 129, 50, 'Oh! It works! Have you sent P', 'Oh! It works! Have you sent P Salamone an invite? Seems like the kind of guy to get a major kick out of this.', '97.122.166.93', 1248198656, 0, 2, '03/', 'Gwen Bell', '', ''),
(35, 0, 129, 49, 'i logged a bug report by', 'i logged a bug report by scheduling your time to fix it :)', '64.207.30.162', 1248198953, 0, 2, '04/', 'Rob Johnson', '', ''),
(36, 0, 129, 37, 'So, if I want Stan to invite', 'So, if I want Stan to invite someone to event B, do I have to create a separate event ahead of time (call it event A) for him to do the inviting?', '72.231.23.173', 1248228728, 0, 2, '05/', 'Ken Reisman', '', ''),
(37, 0, 100, 49, 'maybe this is obvious to', 'maybe this is obvious to other people, but why?', '71.56.217.177', 1248232587, 0, 2, '01/', 'Rob Johnson', '', ''),
(38, 36, 129, 49, 'yeah, i wondered about that', 'yeah, i wondered about that too.  i assume that stan will read the event b description before it occurs and will take necessary preparatory actions when he has free time (assuming, of course, that his entire schedule isn''t full)', '71.56.217.177', 1248232709, 0, 2, '05.00/', 'Rob Johnson', '', ''),
(39, 0, 100, 1, 'I think my friend Adam is', 'I think my friend Adam is trying to get some free tech consulting from me. :)\r\n\r\nHere''s the survey I made:\r\nhttp://spreadsheets.google.com/viewform?formkey=dDFhLTV2bVBwQ0NzOWY5VkZaOTc2Rmc6MA..\r\n\r\n', '89.247.52.85', 1248272023, 0, 2, '02/', 'admin', '', ''),
(40, 0, 126, 23, 'Looking forward to Karoake.', 'Looking forward to Karoake. But I dont'' know any places in Berlin for that. Maybe you should schedule me some time to investigate Karoake places, and to invite some other people. ;)', '89.247.52.85', 1248272108, 0, 2, '05/', 'Stan James', '', ''),
(41, 38, 129, 23, 'If you can, its best to', 'If you can, its best to schedule me the time to do the inviting too. That way I can live as much like a robot and not have to look ahead in my schedule!', '89.247.52.85', 1248272185, 0, 2, '05.00.00/', 'Stan James', '', ''),
(42, 35, 129, 23, 'Hah! Yeah, that''s the best', 'Hah! Yeah, that''s the best way to do it!', '89.247.52.85', 1248272210, 0, 2, '04.00/', 'Stan James', '', ''),
(43, 0, 129, 37, 'I''ve added a bunch of events', 'I''ve added a bunch of events to Stan''s schedule. Please, anyone, feel free to edit whatever I create.', '160.79.51.162', 1248273448, 0, 2, '06/', 'Ken Reisman', '', ''),
(44, 0, 126, 21, 'Where are the pictures on', 'Where are the pictures on "the main page of SimStan" that you said you''d do?  Or does that not work yet?  Are you having enough time to do your reporting, or is it all spent on bug fixing?', '24.8.50.141', 1248275775, 0, 2, '06/', 'Margaret Sparks', '', ''),
(45, 0, 126, 23, 'Adding pictures now....\n(Let', 'Adding pictures now....\r\n(Let me know if you get this comment via email ... you *should* be getting them now. Finger''s crossed!)', '89.247.52.85', 1248282023, 0, 2, '07/', 'Stan James', '', ''),
(46, 0, 153, 22, 'Oops. Think I was supposed to', 'Oops. Think I was supposed to email this to Stan directly...', '173.8.248.246', 1248287148, 0, 2, '01/', 'Derek Greentree', '', ''),
(47, 0, 129, 33, 'I''m not able to create an', 'I''m not able to create an event. I can edit events already created. ', '67.190.143.244', 1248293021, 0, 2, '07/', 'Cherie McCandless', '', ''),
(48, 0, 172, 49, 'cool.  he should definitely', 'cool.  he should definitely do this.  but you should change his schedule on saturday so that he can recover.  perhaps find times for his other previously scheduled events later in the week?', '64.207.30.162', 1248372442, 0, 2, '01/', 'Rob Johnson', '', ''),
(49, 47, 129, 31, 'i was not able either... i', 'i was not able either... i wanted to send you on saturday to heinz miniki and beer in freischwimmer in between the chat with parents and karaoke. and to a party on friday night! \r\n', '85.178.23.120', 1248373045, 0, 2, '07.00/', 'Kira Held', '', ''),
(50, 0, 153, 28, 'so who should i send my email', 'so who should i send my email adress to?', '95.88.6.24', 1248432217, 0, 2, '02/', 'Hans Albern', '', ''),
(51, 0, 126, 28, 'Karaoke is every day in', 'Karaoke is every day in Monster Ronson Ikebana at Warschauer Brücke, but only on monday you dont have to book a cabin in advance. Then its free-for-all. Also I have a problem of creating new dates on the calender, click-dragging doesnt seem to work on my ff3.5 or what do i do wrong?', '95.88.6.24', 1248432484, 0, 2, '08/', 'Hans Albern', '', ''),
(52, 0, 140, 23, 'Ha! Was pretty fun. Sorta', 'Ha! Was pretty fun. Sorta like a Spanish R-rated version of the Blue Man group, but everything done using Sci Fi clichés. Thanks!', '89.247.100.105', 1248470101, 0, 2, '01/', 'Stan James', '', ''),
(53, 0, 170, 23, 'Done and done. Forgot to', 'Done and done. Forgot to summarize my thoughts in the tweet, but didn''t have much room. \r\nhttp://twitter.com/wanderingstan/status/2825906113\r\nNice one!', '89.247.100.105', 1248470528, 0, 2, '01/', 'Stan James', '', ''),
(54, 0, 143, 23, 'Yep, had some nice dinner', 'Yep, had some nice dinner sitting along a canal with a former classmate from Osnabrueck. We bought a big bag of fresh cherries, some "mountain cheese", and some large pretzel-like things at the Turkish market beforehand. Very European evening.', '89.247.100.105', 1248470634, 0, 2, '01/', 'Stan James', '', ''),
(55, 0, 143, 23, 'Yep, had some nice dinner', 'Yep, had some nice dinner sitting along a canal with a former classmate from Osnabrueck. We bought a big bag of fresh cherries, some "mountain cheese", and some large pretzel-like things at the Turkish market beforehand. Very European evening.', '89.247.100.105', 1248470637, 0, 2, '02/', 'Stan James', '', ''),
(56, 0, 166, 1, 'I guess I got 2 points then.', 'I guess I got 2 points then. :)\r\n\r\nThanks for the workout...I needed that. Frisbee seemed to be cancelled yesterday, so some exercise did me good!', '89.247.95.188', 1248682250, 0, 2, '01/', 'admin', '', ''),
(57, 0, 135, 49, 'dude, tell us about how it', 'dude, tell us about how it went.', '64.207.30.162', 1248888827, 0, 2, '01/', 'Rob Johnson', '', '');
